INSERT INTO `item` VALUES (316, '1-A3483A', '176', '', 'Pisang adalah nama umum yang diberikan pada tumbuhan terna berukuran besar dengan daun memanjang dan besar yang tumbuh langsung dari bagian tangkai. Batang pisang bersifat lunak karena terbentuk dari lapisan pelepah yang lunak dan panjang. Batang yang agak keras berada di bagian permukaan tanah.', '', 2, '', '');
INSERT INTO `item` VALUES (317, '100XLG', '295', '', 'Pisang adalah nama umum yang diberikan pada tumbuhan terna berukuran besar dengan daun memanjang dan besar yang tumbuh langsung dari bagian tangkai. Batang pisang bersifat lunak karena terbentuk dari lapisan pelepah yang lunak dan panjang. Batang yang agak keras berada di bagian permukaan tanah.', '', 0, '', '');
INSERT INTO `item` VALUES (318, '128 SDRAM', '175', '', 'Kelebihan bawang putih kating ialah aroma yang wangi dan rasanya yang lebih kuat dibanding bawang putih lainnya. Perlu diperhatikan, penyimpanan bawang ini sebaiknya jangan terlalu lama karena ukurannya dapat menciut. Bawang putih kating bentuknya per siung utuh. Warnanya putih dan kulit tidak terkelupas.', '', 0, '', '');
INSERT INTO `item` VALUES (319, '1GPROC', '175', '', 'Beragam menu bisa dikreasikan untuk olahan ayam fillet untuk anak. Ditambah lagi, tekstur daging fillet yang lembut dan sedikit kenyal. Terasa kian menggugah selera.\n\nFillet merupakan daging yang telah dipisahkan dari tulang. Bahkan sangat tepat bagi Anda dan buah hati yang tengah membatasi asupan lemak. Karena ayam fillet cenderung baik untuk kesehatan dan penuh gizi.', '', 0, '', '');
